<?php

namespace Database\Seeders;

use App\Models\Post;
use Illuminate\Database\Seeder;
use Str;

class PostSeeder extends Seeder
{
    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        Post::create([
            'title' => 'How to fix Error: laravel.log could not be opened?	',
            'slug' => Str::slug('How to fix Error: laravel.log could not be opened?'),
            'status' => Post::STATUS['PUBLISH'],
            'content' => '<p>Typically, when we deploy an laravel apps to Linux-based Operating system, we will need to change the permission of certain folder in order to allowing laravel to access those folder for storage purpose such as :</p><ul><li>Storing Session (if you using file base session, which is default)&nbsp;</li><li>Cached View&nbsp;</li><li>Cached Route</li></ul><p>Normally, it will show error like this:</p><pre class="ql-syntax" spellcheck="false">Error in exception handler: The stream or file "/var/www/laravel/app/storage/logs/laravel.log" could not be opened: failed to open stream: Permission denied in
</pre><p>This is how you will solve the problem is Ubuntu:</p><p><br></p><pre class="ql-syntax" spellcheck="false">sudo chown -R $USER:www-data storage
sudo chown -R $USER:www-data bootstrap/cache
</pre><p>However, in my use case of using synology DSM, the command needed to be modify as the user group in Synology DSM is different from Ubuntu</p><p><img src="data:image/png;base64,"></p><p>First, Open your Synology DSM and go to Control Panel and open Group to identify the group,</p><p><img src="data:image/png;base64,"></p><p><br></p><p>In my enviroment, the web user group should be "http"</p><p><br></p><p><br></p><p>Therefore, direct to your ssh session and change your working directory to web and type in be following command.</p><p><br></p><pre class="ql-syntax" spellcheck="false">sudo chown -R $USER:http storage
sudo chown -R $USER:http bootstrap/cache
</pre><p>PS : Web directory of Synology DSM should be :</p><p><br></p><pre class="ql-syntax" spellcheck="false">/var/services/web$&amp;nbsp;
</pre><p>which you can easily change directory by :</p><p><br></p><pre class="ql-syntax" spellcheck="false">~$&amp;nbsp;cd ../../web
</pre><p>After that, you can procced to change the permission by the following command</p><pre class="ql-syntax" spellcheck="false">chmod -R 775 storage
chmod -R 775 bootstrap/cache
</pre>',
        ]);
//        Post::factory()->count(10)->create();
//        Post::factory()->count(10)->draft()->create();
    }
}
